import styled from "styled-components";
import { Link } from 'react-router-dom';
import '../App.css';
import { TextField, Button } from '@mui/material';
import { useState } from 'react';



const MainWindow = styled.div`
  width: 450px;
  margin: 0 auto;
  margin-top: 180px;
  background-color: #ffffff;
  border: 1px solid black;
  
`

const SwitchSignIn = styled.div`
  width: 100%;
  height: 60px;
  display: flex;
  align-items: center;
  
  a{
    text-decoration: none;
    color: #787d85;
    text-transform: uppercase;
    letter-spacing: 1px;
    font-size: 11px;
    font-weight: 600;
    margin-left: 40px;
    :hover{
      color: black;
      transition: 1500ms;
    }
  }
`


const MainContainer = styled.div`
  width: 84%;
  margin: 0 auto;
  #SignInLine{
    width: 14%;
    border: none;
    border-top: 3px solid #C85E36;
  }
  #headline{
    margin: 30px 0 20px 0px;
    font-size: 24px;
    font-weight: normal;
    color: black;
  }
  .MuiInputBase-root{
    margin-bottom: 20px;
  }
  #outlined-basic{
    width: 350px;
  }
  .MuiButtonBase-root{
    background-color: #f56c2d;
    width: 100%;
    font-size: 14px;
    text-transform: none;
    margin: 30px 0 50px 0px;
    :hover{
      transition: 800ms;
      background-color: #c85e36;
    }
  }
`



const SignIn = () => {

  const [overflow, setOverflow] = useState(0);

  return (
    <>
      <p>Ссылка сработала, заебись</p>
      <Link to='/Dashboard'>Домой</Link>
      <MainWindow>
        <SwitchSignIn>
          <a href="#" onClick={() => setOverflow(0)}>Войти</a>
          <a href="#" onClick={() => setOverflow(1)}>Создать учётную запись</a>
        </SwitchSignIn>

        {

          overflow === 0 ?

            <MainContainer>
              <hr id="SignInLine" />
              <p id="headline">Войти с помощью вашей учётной записи</p>
              <TextField
                id="outlined-basic"
                color="warning"
                size="small"
                label="Адрес электронной почты"
                variant="outlined" />
              <TextField id="outlined-basic"
                color="warning"
                size="small"
                label="Пароль"
                variant="outlined"
                type="password" />
              <Button variant="contained">Войти</Button>
            </MainContainer> :
            <MainContainer>
              <hr id="SignUpLine" />
              <p id="headline">Зарегистрируйте ваш аккаунт</p>
              <TextField
                id="outlined-basic"
                color="warning"
                size="small"
                label="Адрес электронной почты"
                variant="outlined" />
              <TextField id="outlined-basic"
                color="warning"
                size="small"
                label="Пароль"
                variant="outlined"
                type="password" />
              <TextField id="outlined-basic"
                color="warning"
                size="small"
                label="Подтвердите пароль"
                variant="outlined"
                type="password" />
              <Button variant="contained">Регистрация</Button>
            </MainContainer>
        }
      </MainWindow>
    </>
  );
}

export default SignIn;
